const Button = () => {
  return <>
    <StyleButton>
      <span>Login</span>
    </StyleButton>

    <div className="ou">
        <span>ou</span>
      </div>

    <StyleButton><span>Sign Up</span></StyleButton>
  </>

};

export default Button;
